public Analyzer getAnalyzer() {

  if (this.config != null
      && this.config.hasAttribute(AnalyzerAttribute.class)) {
    return ((AnalyzerAttribute) this.config
        .getAttribute(AnalyzerAttribute.class)).getAnalyzer();
  }

  return null;

}

